import React from 'react';
import PropTypes from 'prop-types';
import Head from 'next/head';
import AppLayout from '../components/AppLayout'
import 'antd/dist/antd.css'


const App = ({ Component }) => {

    return (
        <>
            <Head>
                <meta charSet="utf-8" />
                <title>Duo9ham</title>
            </Head>
            <AppLayout>
                <Component />
            </AppLayout>

        </>
    );

};

App.propTypes = {
    Component: PropTypes.elementType.isRequired,
};

export default App;
